Anténa na auto 24 cm
Náhradná anténa pre automobily AM / FM. Univerzálny model so skrutkami rôznych veľkostí, prispôsobiteľný každému automobilu. Jednoduchá inštalácia. Ideálne na výmenu opotrebovanej antény.&nbsp;


Dĺžka: 24 cm


Čistič diskov 750 ml
Špeciálny prostriedok na ALU a oceľové disky. Fľaša s ergonomickým rozprašovačom pre lepšiu aplikáciu na disky. Čistí, chráni a obnovuje lesk ošetrených častí, čím eliminuje všetky stopy nečistôt. Veľmi kvalitná kvapalina, ktorá obnovuje farbu a lesk.
Pre dosiahnutie najlepších výsledkov odporúčame použiť nanášací štetec vďaka, ktorému sa dostanete aj na obtiažne miesta na diskoch.
Použitie:
Pred aplikáciou dôkladne opláchnite vodou ošetrovanú časť. Produkt aplikujte, niekoľko minút nechajte pôsobiť, potom rozpustené nečistoty&nbsp; odstráňte handričkou alebo opláchnutím.&nbsp;
